import React, { useState } from 'react';

const ExaDeAdmisRequViewPage = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCourse, setSelectedCourse] = useState('');
  const [selectedYear, setSelectedYear] = useState('');
  const [selectedExam, setSelectedExam] = useState('');
  const [selectedSemester, setSelectedSemester] = useState('');
  const [selectedBatch, setSelectedBatch] = useState('');
  const [selectedStatus, setSelectedStatus] = useState('');
  const [tableData, setTableData] = useState([]);

  // Function to handle form submission when Add button is clicked
  const handleAdd = () => {
    // Implement your logic to add a new entry to the tableData array
    const newEntry = {
      Date: '2023-07-19',
      Course: selectedCourse,
      Exam: selectedExam,
      Year: selectedYear,
      Semester: selectedSemester,
      Batch: selectedBatch,
      Status: selectedStatus,
      Action: (
        <div>
          <button>Edit</button>
          <button>Delete</button>
          <button>View</button>
        </div>
      ),
      Description: 'Sample description', // Add a description property here
    };

    setTableData([...tableData, newEntry]);
  };

  return (
    <div>
      <h2>Search and Filter</h2>
      <div>
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <select value={selectedCourse} onChange={(e) => setSelectedCourse(e.target.value)}>
          <option value="">Select Course</option>
          <option value="Mathematics">Mathematics</option>
          <option value="Science">Science</option>
          {/* Add more course options as needed */}
        </select>
        <select value={selectedYear} onChange={(e) => setSelectedYear(e.target.value)}>
          <option value="">Select Year</option>
          <option value="2021">2021</option>
          <option value="2022">2022</option>
          <option value="2023">2023</option>
          {/* Add more year options as needed */}
        </select>
        <select value={selectedExam} onChange={(e) => setSelectedExam(e.target.value)}>
          <option value="">Select Exam</option>
          <option value="end">End Exam</option>
          <option value="mid">Mid Exam</option>
          {/* Add more exam options as needed */}
        </select>
        <select value={selectedSemester} onChange={(e) => setSelectedSemester(e.target.value)}>
          <option value="">Select Semester</option>
          <option value="Spring">Spring</option>
          <option value="Summer">Summer</option>
          <option value="Fall">Fall</option>
          {/* Add more semester options as needed */}
        </select>
        <select value={selectedBatch} onChange={(e) => setSelectedBatch(e.target.value)}>
          <option value="">Select Batch</option>
          <option value="Batch A">Batch A</option>
          <option value="Batch B">Batch B</option>
          {/* Add more batch options as needed */}
        </select>
        <select value={selectedStatus} onChange={(e) => setSelectedStatus(e.target.value)}>
          <option value="">Select Status</option>
          <option value="approved">Approved</option>
          <option value="rejected">Rejected</option>
          <option value="pending">Pending</option>
          {/* Add more status options as needed */}
        </select>
        <button onClick={handleAdd}>Add</button>
      </div>

      <h2>Table</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Course</th>
            <th>Exam (end/mid)</th>
            <th>Batch</th>
            <th>Year</th>
            <th>Semester</th>
            <th>Status</th>
            <th>Action</th>
            <th>Description</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, index) => (
            <tr key={index}>
              <td>{row.Date}</td>
              <td>{row.Course}</td>
              <td>{row.Exam}</td>
              <td>{row.Batch}</td>
              <td>{row.Year}</td>
              <td>{row.Semester}</td>
              <td>{row.Status}</td>
              <td>{row.Action}</td>
              <td>{row.Description}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ExaDeAdmisRequViewPage;
